import React from 'react';
import Header from '../src/layouts/header';
import Routes from '../src/routes/index';
import withHeader from './Hoc';
import { BrowserRouter } from 'react-router-dom';

function App() {
	return (
		<div className="App">
			<BrowserRouter>
				<Routes />
			</BrowserRouter>
		</div>
	);
}

export default withHeader(App);
